import React from 'react';

function FaseEliminatoria({ jogos, onAtualizarPlacar }) {
  return (
    <div>
      {jogos.map((jogo, index) => (
        <div key={index}>
          <h4>{jogo.fase}</h4>
          <p>{jogo.dupla1.join(' & ')} vs {jogo.dupla2.join(' & ')}</p>
          <input 
            value={jogo.placar}
            onChange={(e) => onAtualizarPlacar(jogo, e.target.value)}
            placeholder="Placar"
          />
        </div>
      ))}
    </div>
  );
}

export default FaseEliminatoria;
